1. 葡萄牙足球超级联赛冠军：18次（1935-36, 1 nine, five, seven, eight, nine ,ten, eleven, twelve, thirteen, fourteen, fifteen, sixteen, seventeen, eighteen, nineteen, twenty, and twenty-one)；
2.葡萄牙杯赛冠军（Taça de Portugal）：9次 (1nine, two, four, six, ten, eleventh, twelfth, thirteenth, fifteenth) ;
3.葡超杯冠军(Taçaporto)：7次(two, three, fiver, one thousand nine hundred ninety-five, ninteen hundred Ninety Seven, NinteNinerly, Two Thousand One);
4.欧洲冠军联赛/欧洲杯夺冠冠军: 2次 （two thousand and three and two thousand);
5.洲际杯/世界俱乐部杯亚军: once (two thouand one)。
